				<div key="following">짹짹 <br /> 0</div>]}>
					<Card.Meta avatar={<Avatar>ZC</Avatar>} title="yeni" />
					<Button onClick={onLogOut}>로그아웃</Button>
        </Card>

    )

};

export default UserProfile;
